import React from 'react';

interface State {
  todo: any;
}

class Form extends React.Component<State> {

  state: State = {
    todo: 'hoge',
  };

  render() {
    return (
      <form>
        <input
          type="text"
          value={this.state.todo}
        />
        <button>登録</button>
      </form>
    );
  }

}

export default Form;
